import React from 'react';
import { styled } from '@mui/material/styles';
import {
    Paper,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    Typography,
    Box
} from '@mui/material';
import { MarketDepth } from '../../types/marketData';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    padding: theme.spacing(1),
    textAlign: 'center',
}));

const BuyQuantity = styled(Typography)(({ theme }) => ({
    color: theme.palette.success.main,
}));

const SellQuantity = styled(Typography)(({ theme }) => ({
    color: theme.palette.error.main,
}));

interface Props {
    depth: MarketDepth;
}

export const DepthView: React.FC<Props> = ({ depth }) => {
    return (
        <Box>
            <Typography variant="h6" gutterBottom>
                Market Depth
            </Typography>
            <TableContainer component={Paper}>
                <Table size="small">
                    <TableHead>
                        <TableRow>
                            <StyledTableCell>Bid Qty</StyledTableCell>
                            <StyledTableCell>Bid Price</StyledTableCell>
                            <StyledTableCell>Ask Price</StyledTableCell>
                            <StyledTableCell>Ask Qty</StyledTableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {depth.buys.map((bid, index) => (
                            <TableRow key={index}>
                                <StyledTableCell>
                                    <BuyQuantity>
                                        {bid.buy_quantity}
                                    </BuyQuantity>
                                </StyledTableCell>
                                <StyledTableCell>
                                    {bid.buy_price.toFixed(2)}
                                </StyledTableCell>
                                <StyledTableCell>
                                    {depth.sells[index]?.sell_price.toFixed(2)}
                                </StyledTableCell>
                                <StyledTableCell>
                                    <SellQuantity>
                                        {depth.sells[index]?.sell_quantity}
                                    </SellQuantity>
                                </StyledTableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </Box>
    );
};
